        padding: '20px',
    
    }

    const largerTextStyles = {
        fontSize: '25px',
    };

    const smallerTextStyles = {
        fontSize: '15px',
    };
    console.log(room.imageUrl);
    return (
        <div style={backgroundColorStyles}>
            <h1 style={{ textAlign: "center", fontFamily: "'Press Start 2P', sans-serif" }}>{room.name}</h1>
            <p style={smallerTextStyles}>Description: {room.description}/5</p>
        </div>
    );
}
